                },

                {
                    name: 'Syndel'
                },

                {
                    name: 'Cetrion'
                },

                {
                    name: 'Fujin'
                },
            
            ]
        }
    }

    render(){ 
        return(
            <div className='col-md-3 col-sm-6 mb-5'>
                <div className="card">
                    <div className="card-header">        
                        <h1>{this.props.CharNames.name}</h1>
                    </div>   
                </div>
            </div>
        );      
    }   
}
